  

// TypeScript Version: 4.1

/**
* Computes the multiplicative inverse of a single-precision floating-point number `x`.
*
* ## Notes
*
* -   The multiplicative inverse is defined as `1/x`.
*
* @param x - input value
* @returns multiplicative inverse
*
* @example
* var v = invf( -1.0 );
* // returns -1.0
*
* @example
* var v = invf( 2.0 );
* // returns 0.5
*
* @example
* var v = invf( 0.0 );
* // returns Infinity
*
* @example
* var v = invf( -0.0 );
* // returns -Infinity
*
* @example
* var v = invf( NaN );
* // returns NaN
*/
declare function invf( x: number ): number;


// EXPORTS //

export = invf;
